function getDate(format){ 
var oDate = new Date(), oYear = oDate.getFullYear(), oMonth = oDate.getMonth()+1, oDay = oDate.getDate(), oHour = oDate.getHours(), oMin = oDate.getMinutes(), oSec = oDate.getSeconds(); 
var oTime = "";
if(format == 'YYYY-MM-DD') 
{ oTime = oYear +'-'+ this.getzf(oMonth) +'-'+ this.getzf(oDay) }
else if(format == 'yyyy/mm/dd'){ oTime = oYear +'/'+ this.getzf(oMonth) +'/'+ this.getzf(oDay);}

return oTime; }

 function getzf(num){
 if(parseInt(num) < 10){ num = '0'+num; } 
return num; }
